// SPDX-License-Identifier:MIT
pragma solidity ^0.8;

contract back{
    event Log(string func,uint value);
    // 有data的话会触发fallback
    fallback()external payable{
        emit Log("fallback",msg.value);
    }
    // 没有data会触发receive
    receive() external payable{
        emit Log("receive",msg.value);
    }//必须加上payable 是用来处理钱回退的处理

    function getBalance()external view returns(uint){
        return address(this).balance;
    }
}

contract SendEth{
    constructor() payable{

    }
    receive() external payable{}
    function sendViaTransfer(address payable _to)external payable {
        _to.transfer(123);//发的是123个wei
    }
    function sendViaSend(address payable _to)external payable {
        bool success = _to.send(123);
        require(success,"send fail");
    }
    function sendViaCall(address payable _to)external payable {
       (bool success,)= _to.call{value:123}("");//注意语法的不一样  后面的括号指的是附带的数据
       require(success,"call fail");
    }
    function getBalance()external view returns(uint){
        return address(this).balance;
    }
}

